        top: '-7px',
        background: 'none',
        webkitAppearance: 'none',
        mozAppearance: 'none',
    }

    return (
        <>
            <input type='range' min='1' max='100' style={{style}}></input>
            <input type='range' min='1' max='100' style={{style}}></input>
        </>
    )
}

export default Multislider
